INSERT INTO `wp_posts` VALUES (15,1,'2024-10-09 13:30:19','2024-10-09 13:30:19','<h1>Web Developer</h1>		\n													<img width=\"240\" height=\"240\" src=\"http://hirehub.local/wp-content/uploads/2024/10/Pixelz_transparent_Craiyon.png\" alt=\"\" srcset=\"http://hirehub.local/wp-content/uploads/2024/10/Pixelz_transparent_Craiyon.png 240w, http://hirehub.local/wp-content/uploads/2024/10/Pixelz_transparent_Craiyon-150x150.png 150w\" sizes=\"(max-width: 240px) 100vw, 240px\" />													\n		<p>Pixelz Studio</p><p>Bengaluru, India</p><p>Full-Time</p><p>Remote</p><p>Fresher</p><p>About This Role</p>		\n			<h4>As a Web Developer at Pixelz Studio, you\'ll design and implement dynamic, responsive websites that cater to our users\' needs across multiple platforms. Your technical expertise will drive innovative solutions that enhance functionality and user engagement. Join us in shaping impactful digital experiences at Pixelz Studio!\"</h4>		\n			<p>Qualification</p>		\n		<p>At least 2-4 years of relevant experience in web development or related roles. Proficient in front-end technologies (HTML, CSS, JavaScript) and back-end frameworks. Strong understanding of responsive design and web performance optimization. Familiarity with version control systems, such as Git, and experience with analytics tools to gather user data for enhancing website functionality.\"</p>		\n			<p>Job Description</p>		\n		<p>At least 2-4 years of relevant experience in web development or related roles. Proficient in front-end technologies (HTML, CSS, JavaScript) and back-end frameworks. Strong understanding of responsive design and web performance optimization. Familiarity with version control systems, such as Git, and experience with analytics tools to gather user data for enhancing website functionality.</p>		\n			<p>Base Pay Range</p>		\n		<p>5L  7L/yr</p>		\n			<a href=\"#\">\n									Apply Now\n					</a>\n			<a href=\"#\">\n									Share\n					</a>\n			<h2>Similar Jobs</h2>		\n													<img width=\"240\" height=\"240\" src=\"http://hirehub.local/wp-content/uploads/2024/10/Pixelz_transparent_Craiyon.png\" alt=\"\" srcset=\"http://hirehub.local/wp-content/uploads/2024/10/Pixelz_transparent_Craiyon.png 240w, http://hirehub.local/wp-content/uploads/2024/10/Pixelz_transparent_Craiyon-150x150.png 150w\" sizes=\"(max-width: 240px) 100vw, 240px\" />													\n		<p>Sr. UX Designer</p><p>Pixelz Studio</p><p>Bangalore,India</p><p>Internship</p><p>On-Site</p><p>Fresh Graduates</p>		\n			<a href=\"#\">\n									Apply\n					</a>\n			<a href=\"#\">\n									Share\n					</a>\n													<img width=\"1024\" height=\"1024\" src=\"http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon-1024x1024.png\" alt=\"\" srcset=\"http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon-1024x1024.png 1024w, http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon-300x300.png 300w, http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon-150x150.png 150w, http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon-768x768.png 768w, http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon-1536x1536.png 1536w, http://hirehub.local/wp-content/uploads/2024/10/ovo-ewallet-payment-icon-symbol-free-png_transparent_Craiyon.png 1920w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" />													\n		<p>Jr.UI Designer</p><p>Ovo</p><p>Hyderabad,India</p><p>Full-Time</p><p>On-Site</p><p>1-3 Years</p>		\n			<a href=\"#\">\n									Apply\n					</a>\n			<a href=\"#\">\n									Share\n					</a>\n													<img width=\"393\" height=\"234\" src=\"http://hirehub.local/wp-content/uploads/2024/10/gojek_transparent_Craiyon.png\" alt=\"\" srcset=\"http://hirehub.local/wp-content/upload